import { useState } from 'react';
import './App.css';

function App() {
  let [selectedUser, setSelectedUser] = useState<string | null>(null)

  return (
    <div style={{display:'flex'}}>
      <div>
        <div>
          <input placeholder="search" />
          <button>find</button>
        </div>
        <ul>
          {['dimych','artem'].map(u => <li
            style={{backgroundColor:(selectedUser == u) ? 'black' : ''}}
            onClick={() => {
            setSelectedUser(u)
            document.title = u
          }}>{u}</li>)}
        </ul>
      </div>
      <div>
        <h2>username</h2>
        <div>details</div>
      </div>
    </div>
  );
}

export default App;
